        int xhi = xl >> 32; // FRACTIONAL_PLACES
        uint ylo = uint(yl & int(0x00000000FFFFFFFF));
        int yhi = yl >> 32; // FRACTIONAL_PLACES

        uint lolo = xlo * ylo;
        int lohi = int(xlo) * yhi;
        int hilo = xhi * int(ylo);
        int hihi = xhi * yhi;

        uint loResult = lolo >> 32; // FRACTIONAL_PLACES
        int midResult1 = lohi;
        int midResult2 = hilo;
